import React from 'react';
import Navbar from "./components/Navbar/Navbar";
import './App.css';
import bottomBar from "./components/Navbar/bottomBar";

function App() {
  return (
    <div className="App">
            <Navbar />
      <bottomBar />
    </div>
  );
}

export default App;
